Jessica-Jane Clement (born 24 February 1985 in Sheffield, South Yorkshire, England)[1] is a British glamour model, actress and TV presenter who is best known for starring in the BBC programme The Real Hustle.
Modelling

Clement began her career as a Page Three model. At the age of 18 she appeared in Playboy and has modelled for photographers Byron Newman and the late Bob Carlos Clarke. She has since appeared in various lads' mags as a result of her popularity in The Real Hustle.[3]

Clement has starred in the music videos for several songs including You and Me by British dance act Uniting Nations,[4] Craig David's All the Way,[5] Christian Blaizer's All I Want[6] and Studio B's I see Girls.[7]

Since 2010, Clement has been a spokesmodel for grooming product company Lynx, promoting their Lynx Rise range.[8]

Clement placed #54 in ZOO's hot 101 of 2009, #26 in Nuts' 100 Sexiest of 2009, #32 in the Top 100 ZOO's Beach Babe Awards 2011 and was #46 in FHM's 100 Sexiest Women of 2009.[9]
